Women and girls represent half of the world’s population, but not one country has achieved gender equality. Empowering women and girls and advancing gender equality is critical to achieving the #GlobalGoals and a better future for everyone.

Women's leadership is essential to peace and progress for all. Yet, around the world and across all sectors, women continue to be underrepresented in leadership roles. Currently, only 22 among the 193 #UnitedNations member countries are led by women

@unwomen is working everyday to promote gender equality around the world. Tell us in the comments below what you are doing for #GenerationEquality.
